import React from 'react';
import Moment from 'react-moment';

export const AnnouncementItem = (props) => {
  const isSelected = false;
  return (
    <li className="mt-2">
      <div className="row">
        <div className="col-5">
          <span>{props.title}</span>
        </div>
        <div className="col-1">
          <button className="btn btn-outline-danger float-left" type="button">
            <i class="fa fa-trash"></i>
          </button>
        </div>
        <div className="col-1 mr-1">
          <button className="btn btn-outline-warning float-right" type="button">
            <i class="fa fa-pencil"></i>
          </button>
        </div>
        {isSelected && (
          <div className="row">
            <span>{props.description}</span>
            <div className="col-2">
              <Moment format="YYYY/MM/DD">{props.date}</Moment>
            </div>
          </div>
        )}
      </div>
    </li>
  );
};
